
create extension if not exists "uuid-ossp";

drop table if exists supplier_7ym, product_k2q, supplier_product_info_6ty, car_sit, supplier_car_info_7u0 cascade;

create table supplier_7ym
(
    id      uuid primary key,
    name    text,
    phone   text
);

create table product_k2q
(
    id              uuid primary key,
    model           text,
    category        text,
    brand           text,
    score           numeric,
    screen_material text,
    screen_size     int,
    height          int,
    width           int,
    weight          int,
    sales_start     int,
    sales_end       int,
    os              text,
    color           text
);

create table supplier_product_info_6ty
(
    supplier_id uuid references supplier_7ym,
    product_id uuid references product_k2q,
    price numeric,
    quantity int,
    primary key (product_id, supplier_id)
);

create table car_sit
(
    id                uuid primary key,
    model             text,
    body_volume       int,
    lifting_capacity  int
);

create table supplier_car_info_7u0
(
    supplier_id uuid references supplier_7ym,
    car_id uuid references car_sit,
    quantity int,
    primary key (car_id, supplier_id)
);







select * from supplier_7ym;
select * from product_k2q;
select * from supplier_product_info_6ty;
select * from car_sit;
select * from supplier_car_info_7u0;


-- 1
select model, sales_start, sales_end from product_k2q
where category = 'часы' and sales_start = 2023 and sales_end is null;


--2 
select name from product_k2q
join supplier_product_info_6ty on supplier_product_info_6ty.product_id = product_k2q.id
join supplier_7ym on supplier_7ym.id = supplier_product_info_6ty.supplier_id
where os = 'Linux'
except
select name from product_k2q
join supplier_product_info_6ty on supplier_product_info_6ty.product_id = product_k2q.id
join supplier_7ym on supplier_7ym.id = supplier_product_info_6ty.supplier_id
where os = 'Windows';

--3
select name from product_k2q
join supplier_product_info_6ty on supplier_product_info_6ty.product_id = product_k2q.id
join supplier_7ym on supplier_7ym.id = supplier_product_info_6ty.supplier_id
where category = 'часы'
intersect 
select name from product_k2q
join supplier_product_info_6ty on supplier_product_info_6ty.product_id = product_k2q.id
join supplier_7ym on supplier_7ym.id = supplier_product_info_6ty.supplier_id
where category = 'электронные книги';

--4
select name from product_k2q
join supplier_product_info_6ty on supplier_product_info_6ty.product_id = product_k2q.id
join supplier_7ym on supplier_7ym.id = supplier_product_info_6ty.supplier_id
where brand = 'Apple'
union
select name from car_sit
join supplier_car_info_7u0 on car_sit.id = supplier_car_info_7u0.car_id 
join supplier_7ym on supplier_7ym.id = supplier_car_info_7u0.supplier_id
where lifting_capacity > 25;

--5

select min(price), max(price), avg(price), sum(price*quantity) from product_k2q
join supplier_product_info_6ty on supplier_product_info_6ty.product_id = product_k2q.id
where brand = 'MSI';


--6

(select max(screen_size) from product_k2q where category = 'ноутбуки');
(select min(weight) from product_k2q where category = 'ноутбуки');

with max_screen_sized as (select * from product_k2q
where screen_size = (select max(screen_size) from product_k2q where category = 'ноутбуки'))
select model from max_screen_sized
where weight = (select min(weight) from max_screen_sized);

